<H1><A NAME="lnk4544"></A><SUP></SUP>Linker Tools Warning LNK4544</H1>

<P class=dt><B>Symbol "symbol" specified with /IMPORT not referenced in application - ignored</B></P>

<P>You specified a symbol with the /IMPORT option but it was not referenced in your program so the linker ignored it.</P>
